column128:
 'description': ""L'agence Particip&Co est spécialiste du débat et de la concertation augmentés par les outils numériques. Elle propose les prestations suivantes :
- conception de dispositifs de débat exclusivement en ligne (e-débats) ou articulés avec des démarches en présentiel ;
- production de textes et d'infographies ;
- facilitation du e-débat (animation et modération) ;
- élaboration et mise en œuvre de la stratégie de communication digitale ;
- analyse et la synthèse des avis et arguments exprimés ;
- conseil

